package com.company.library_project.entity.profile;import com.company.library_project.entity.base.StringBaseEntity;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Table;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Setter@Getter@NoArgsConstructor@Entity@Table(name = "email_history")public class EmailHistoryEntity extends StringBaseEntity {    @Column(name = "message", columnDefinition = "TEXT")    private String message;    @Column(name = "email")    private String email;}